import React from 'react'
var moment = require('moment')

function GraphTitle(props) {
    const { time } = props;
    let newDate = new Date();
    const weekday = time * 1000
    newDate.setTime(weekday)

    return (
        <h3>
            {moment(newDate).format('dddd')}
        </h3>
    )
}

export default GraphTitle;
